import React from "react";
import {
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBCardTitle,
  MDBBtn,
  MDBCardText
} from "mdbreact";

class Card extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <MDBCard>
        <MDBCardImage
          src={props.image}
          alt="MDBCard image cap"
          top
          hover
        />
        <MDBCardBody>
          <MDBCardTitle tag="h5">{props.title}</MDBCardTitle>
          <MDBCardText>
            {props.text}
          </MDBCardText>
          <MDBBtn color="primary" size="md">
            read more
          </MDBBtn>
        </MDBCardBody>
      </MDBCard>
    );
  }
}

export default Card;
